import React from "react";
import "../css/navbar.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { icon } from '@fortawesome/fontawesome-svg-core/import.macro'

const Navbar: React.FC = () => {
    return (
        <div className="navbar">
            <div className="navbar-left">
                <a className="github" href="https://github.com/esoccoli"><FontAwesomeIcon className="github-icon" icon={icon({ name: 'github', style: 'brands' })} /></a>
                <a className="linkedin" href="https://linkedin.com/in/ella-soccoli"><FontAwesomeIcon className="linkedin-icon" icon={icon({ name: 'linkedin', style: 'brands' })} /></a>

            </div>
        </div>
    )
}

export default Navbar;
